import { Switch, Route, Link } from "react-router-dom";
import axios from "axios";
import { useHistory } from "react-router-dom/cjs/react-router-dom.min";

const Card = (props) => {
    const [style, setStyle] = useState("cardText1");
    const [style2, setStyle2] = useState("cardText2");

    const onMouseEnterEventHandler1 = () => {
        setStyle("cardTexth1h");
    };
    const onMouseLeaveEventHandler1 = () => {
        setStyle("cardText1");
    };
    const onMouseEnterEventHandler2 = () => {
        setStyle2("cardText2h");
    };
    const onMouseLeaveEventHandler2 = () => {
        setStyle2("cardText2");
    };

    return (
        <>
            <div
                id="cardOutline"
                style={{ backgroundImage: `url(${props.imageUrl})` }}
            >
                <div
                    className={style}
                    id="base"

                    onMouseEnter={onMouseEnterEventHandler1}
                    onMouseLeave={onMouseLeaveEventHandler1}
                ></div>

            </div>
        </>
    );
};

export default Card;
